import Footer from './Footer';
import Nav from './Nav';
import Main from './Main';
import Header from './Header';
import Reviews from './Reviews'
import About from './About'
import '../App';


const HomePage = () => {
    return (
        <div className="App">
            <Nav />
            <Header/>
            <Main/>
            <Reviews/>
            <About/>
            <Footer/>
      </div>
    )
}

export default HomePage;
